var app = angular.module("myBlog", ["ui.router", "textAngular"]);

app.config(function($stateProvider, $urlRouterProvider) {

    $urlRouterProvider.otherwise("/");

    $stateProvider
        .state("admin-all-blogs", {
            url: "/blogs",
            templateUrl: "/admin/blogs-page",
            controller: "ListDeleteCtrl"
        })
        .state("admin-create-blog", {
            url: "/blog/new",
            templateUrl: "/admin/blog/new",
            controller: "CreateUpdateCtrl"
        })
        .state("admin-update-blog", {
            url: "/blog/:id/update",
            templateUrl: "/admin/blog/update",
            controller: "CreateUpdateCtrl"
        });
});
app.factory("myBlogFactory", function($http) {

    return {

        // get all blogs
        allBlogs: function() {
            return $http.get("/admin/blogs");
        },

        // edit blog
        editBlog: function(id) {
            return $http.get("/admin/blog/" + id + "/edit");
        },

        // update blog
        updateBlog: function(blog) {
            return $http.post("/admin/blog/" + blog._id + "/update", blog);
        },

        // delete blog
        deleteBlog: function(id) {
            return $http.post("/admin/blog/" + id + "/delete");
        },

        // create blog
        createBlog: function(blog) {
            return $http.post("/admin/blog/create", blog);
        }

    }
});
/**
 * All blogs/Delete Blog Controller
 */
app.controller("ListDeleteCtrl", function($scope, $state, myBlogFactory) {

    $scope.blog = {};
    $scope.modal = false;

    // Get All Blogs
    myBlogFactory.allBlogs().then(function(res){
        $scope.blogs = res.data;
    });

    // Cancel Modal
    $scope.cancelModal = function() {
        $scope.modal = false;
    };

    // Show Delete Modal
    $scope.showDeleteModal = function(id) {
        $scope.modal = true;
        $scope.modal = myBlogFactory.editBlog(id).then(function(res) {
            $scope.blog = res.data;
        });
    };

    // Delete Blog
    $scope.deleteBlog = function(id) {
        myBlogFactory.deleteBlog(id).then(function(result) {
            if(result.data.success) {
                $state.go($state.current, {}, { reload: true });
            }
        });
    };

});

/**
 * Blog Create/Update Controller
 */
app.controller("CreateUpdateCtrl", function($scope, $state, $stateParams, myBlogFactory) {

    // get blog by id if update page
    if($stateParams.id) {
        myBlogFactory.editBlog($stateParams.id).then(function(res) {
            $scope.blog = res.data;
        });
    }

    // Create blog
    $scope.createBlog = function() {
        myBlogFactory.createBlog($scope.blog).then(function(result) {
            if(result.data.success) {
                $scope.blog = {};
                $state.go("admin-all-blogs");
            }
        });
    };

    // Update blog
    $scope.updateBlog = function(blog) {
        myBlogFactory.updateBlog(blog).then(function(result) {
            if(result.data.success) {
                $state.go("admin-all-blogs");
            }
        });
    };
});
